description:
Uniform Girls 2 (2014)

Nach einem langweiligen Saftschubser-Flug hat die dauergeile Flugbegleiterin Amanda nichts eiligeres zu tun, als den letzten Fluggast zu einem Hohenflug in den siebten Himmel zu verfuhren. Polizeihauptmeisterin Patrizia Melbery Baric lasst sich von zwei Eierdieben in der Tiefgarage in den Arsch ficken. Dienstmadchen Silvia wird vom Hausherrn auf die Besetzungscouch gebeten und die blutjunge Cheerleaderin Bella kann ihre prallen Pompons erfolgreich dem Sportchef um die Eier hauen.

Hardcore, Nylon/Stocking, Uniform 

